import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function MyButton() {
  const [count, setCount] = useState(0);
  function handleClick() {
    setCount(count+1);
  }
  return (
    <>
    <button onClick={handleClick}>I'm a button</button>
    <p>Big man clicked {count} times</p>
    </>

  );
}

function LoginPage(){

  return(
    <div className='Butt'>
      <img src={logo} className="App-logo" alt="logo" />
      <p>helpme</p>
      <form>
        <label for="uname">Username</label>
        <input type='text' id='uname' name='uname'/><br></br>
      </form>
    </div>

  );
}


function Testing(){
  return(
    <>
    <p>This is where I begin my villain monologue.</p>
    <h1>But <br /> nahhh</h1>
    </>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <LoginPage />
      </header>
      <body className="App-Testing">
        <p>HELLO</p>
        <MyButton />
        <Testing />

      </body>
    </div>
  );
}

export default App;
